import React from "react";

function Testimonial(){
    return <div class="testimonial">
        <section class="testimonial-section">
            <p class="container-fluid">
                You know what? It is beets. I've crashed into a beet truck. Must go faster. Did he just throw my cat out of the window? Must go faster. I was part of something special. I gave it a cold? I gave it a virus. A computer virus. Must go faster... go, go, go, go, go!

                This thing comes fully loaded. AM/FM radio, reclining bucket seats, and... power windows. Jaguar shark! So tell me - does it really exist? God help us, we're in the hands of engineers. Hey, you know how I'm, like, always trying to save the planet? Here's my chance.
            </p>
        </section>
    </div>
}

export default Testimonial;
